import { map } from "jquery";

export default class FX {



    constructor() {
        this.fixerServer = 'http://data.fixer.io/api/latest?access_key=ffcc344a3f31700c0020d166fd17ea96';
        this.RatesMap = new Map();

        fetch(this.fixerServer)
        .then(res => res.json())
        .then(data => {
            this.fixerData = data;
            this.refreshRatesValues();        
        });
    }

    refreshRatesValues () {
        console.log(this.fixerData);
        this.RatesMap.set('EURUSD', this.fixerData.rates.USD); // 1EUR -> USD a
        this.RatesMap.set('EURARS', this.fixerData.rates.ARS); // 1EUR -> ARS b
        this.RatesMap.set('EURBRL', this.fixerData.rates.BRL); // 1EUR -> BRL c

        this.RatesMap.set('USDARS', this.fixerData.rates.ARS / this.fixerData.rates.USD); // 1USD -> monto ARS
        this.RatesMap.set('USDBRL', this.fixerData.rates.BRL / this.fixerData.rates.USD); // 1USD -> monto BRL
        this.RatesMap.set('BRLARS', this.fixerData.rates.ARS / this.fixerData.rates.BRL); 
        console.log(this.RatesMap);
    }

    get data(){
        return 'this.fixerData';
    }
}
